import React from 'react'

const Instagram = () => {

    let data=[
        {
            id:1,
            imgSrc:Img1,
        },
        {
            id:2,
            imgSrc:Img1,
        },
        {
            id:3,
            imgSrc:Img1,
        },
        {
            id:4,
            imgSrc:Img1,
        },
        {
            id:5,
            imgSrc:Img1,
        },
        {
            id:6,
            imgSrc:Img1,
        },
    ]

    return (
        <>
           <div class="section-title" id='potrait'>
            <span>My Portfolio</span>
             <h2>My Portfolio</h2>
            
         </div>
           <div className='gallery'>
               {data.map((item,index) =>{
                   return(
                       <div className='pics' key={index}>
                           <img  src={item.imgSrc}/ >
                       </div>    
                   )
               })}
           </div>
        </>
    )
}

export default Instagram
